const Paginado = ({porPag,pokemon,paginado}) => {
    const pageNumbrers = []
     for (let i = 1; i <= Math.ceil(pokemon/porPag); i++) {
         pageNumbrers.push(i)   
     }
     return(
         <nav /* className={s.paginadoContainer} */>
             <ul /* className ={s.ul} */>
                {
                 pageNumbrers.map(number =>(
                     <li key={number}>
                         <a className ={s.numeroPaginado} onClick={()=>paginado(number)}> {number} </a>  
                     </li> 
                 ))}
             </ul>
         </nav>
     )
}
 
export default Paginado;
